_DESCRIPTION_:
Цветная уличная камера Sarmatt SR-N70F36IR - высококачественная камера, основанная на новом процессоре обработки видеосигнала Effio. Применение новой технологии обеспечивает передачу идеально четкого детального изображения в дневных и ночных условиях. Благодаря поддержке большого количества функций (ATR, BLC, DNR и других) удалось добиться разрешения 650 ТВЛ в цветном режиме и 700 ТВЛ в черно-белом. Выполнена в антивандальном корпусе белого цвета и может быть установлена как внутри помещения, так и на улице. Объектив с фокусным расстоянием 3.6 мм, режим 'день-ночь' (автоматический переход в черно-белый режим работы при ухудшении освещенности), компенсация встречной засветки (BLC), динамическое подавление шумов (DNR). Видеосигнал передается в стандарте PAL, максимальное расстояние по кабелю типа RJ-59 - 300 метровТехнические характеристики Sarmatt SR-N70F36IR:
Тип матрицы: 1/3" Interline Transfer Type Color CCD (SONY);
Объектив:  f=3,6 мм;
Разрешение: 700Твл;
Чувствительность: 0.01 Лк;
OSD меню: есть;
Питание: DC 12В;
Температурный диапазон: от -40С до +50С;
Функции Sarmatt SR-N70F36IR:
День/Ночь(цифровой)- автоматически обеспечивает переключение цветного режима(день) на черно-белый(ночь) в зависимости от времени суток, что позволяет получать качественное, контрастное и сфокусированное изображение.
DNR- подавление шумов, предназначенное для обеспечения более четкого изображения в условиях низкой освещенности, во время того как в кадре появляется шум.
BLC- компенсация заднего света, позволяет камере автоматически регулировать усиление и электронный затвор, что в результате компенсирует излишки света и не мешает восприятию окружающего мира.
AWB(автоматический баланс белого)- функция позволяющая компенсировать искажение цветов, вызванные разными источниками освещения(солнечный свет, лампы накаливания или флуоресцентный свет).
AGC- усиливает сигнал при слабой освещенности, что позволит получить качественное изображение на экране монитора.
ATR- адаптивное воспроизведение световых тонов, то есть камера автоматически может настраивать яркость и контрастность в местах с разной освещенностью. 
