Блок бесперебойного питания в пластиковом корпусе AccordTec ББП-20 исп.1 предназначен для бесперебойного питания устройств и приборов охранно-пожарной сигнализации, активных датчиков, систем видеонаблюдения, электромагнитных и электромеханических замков, а также другой аппаратуры с напряжением питания 12V. Блок выполнен в пластиковом корпусе. AccordTec ББП-20 исп.1 обладает рядом особенностей, а именно:автоматический переход без задержки на питание от встроенного аккумулятора при пропадании сетевого напряжения;
световая индикация состояния сетевого и выходного напряжений;
защита от превышения тока нагрузки короткого замыкания в цепи нагрузки;
зарядка аккумулятора и поддержание его в заряженном состоянии при наличии сетевого напряжения;
сертификат №РОСС RU МП06.С00530, выданный Органом по сертификации средств автоматизации Академии технологической кибернетики.

